import React from "react";
import styled from "styled-components";
import Button from "./Button";
import Container from "./Container";

const TextContainer = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
`

const Information = () => {
    const state = {
        position: "сетка",
        count: 210,
        block: "да",
    }
    return (
        <Container>
            <TextContainer>
                <p>ПОЛОЖЕНИЕ БЛОКОВ:</p><span>{state.position.toUpperCase()}</span>
            </TextContainer>
            <TextContainer>
                <p>ЗНАЧЕНИЕ СЧЕТЧИКА:</p><span>{state.count}</span>
            </TextContainer>
            <TextContainer>
                <p>БЛОКИРОВКА СЧЕТЧИКА:</p><span>{state.block.toUpperCase()}</span>
            </TextContainer>
            <Button>ВЫВЕСТИ ИНФУ В БЛОК 4</Button>
        </Container>
    )
}

export default Information;
